var idID={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Izinkan","Allow in your wallet":"Biarkan di dompet Anda","Allow {symbol} first":["Izinkan ",["symbol"]," dulu"],"Allowance pending":"Tunjangan tertunda","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Terjadi kesalahan saat mengeksekusi swap ini. Anda mungkin memerlukan peningkatan toleransi slip Anda. Jika tidak berhasil, kemungkinan token yang anda perdagangkan tidak cocok. Catatan: biaya transfer token rebase tidak cocok dengan Uniswap V3.","Approval pending":"Persetujuan Tertunda","Approve":"Setujui","Approve Permit2":"Approve Permit2","Approve in your wallet":"Setujui di dompet Anda","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Setujui ",["symbol"]," dulu"],"Auto":"Otomatis","Auto Router":"Router Otomatis","Auto Router API":"Auto Router API","Balance:":"Saldo:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Tutup","Confirm in your wallet":"Konfirmasi di dompet Anda","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Hubungkan dompet","Connecting…":"Menghubungkan…","Continue":"Continue","Convert {0} to {1}":["Ubah ",["0"]," menjadi ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Putuskan sambungan dompet","Dismiss":"Buang","Enter an amount":"Masukkan jumlah","Error fetching trade":"Terjadi kesalahan saat mengambil perdagangan","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Mengambil harga terbaik…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Slippage tinggi meningkatkan risiko pergerakan harga","I don't have a wallet":"Saya belum punya dompet","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Saldo ",["0"]," tidak cukup"],"Invalid recipient":"Penerima tidak valid","Max":"Max","Max slippage":"selip maksimum","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Ketergantungan yang hilang","Network fee":"Biaya jaringan","No results found.":"Hasil tidak ditemukan.","No tokens are available on this network. Please switch to another network.":"Tidak ada token yang tersedia di jaringan ini. Silakan beralih ke jaringan lain.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Harap masukkan % slippage yang valid","Powered by the Uniswap protocol":"Didukung oleh protokol Uniswap","Price impact":"Dampak harga","Price updated":"Harga diperbarui","Reload":"Reload","Reload the page":"Muat ulang halaman","Request rejected":"Request rejected","Review swap":"Tukar ulasan","Search by token name or address":"Cari berdasarkan nama token atau alamat","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Ada yang salah","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Berhasil","Swap":"Tukar","Swap failed: {0}":["Tukar gagal: ",["0"]],"Switch network":"Beralih jaringan","Switch network in your wallet":"Beralih jaringan di dompet Anda","Switching network":"Beralih jaringan","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Invarian Uniswap x*y=k tidak dipenuhi oleh penukaran. Ini biasanya berarti salah satu token yang Anda tukar menyertakan perilaku khusus saat transfer.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Token input tidak dapat ditransfer. Mungkin ada masalah dengan token input.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Token output tidak dapat ditransfer. Mungkin ada masalah dengan token output.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Output token tidak dapat ditransfer. Mungkin ada masalah dengan output token. Catatan: biaya transfer dan token rebase tidak sesuai dengan Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Transaksi ini tidak akan berhasil karena pergerakan harga. Coba tingkatkan toleransi selip Anda. Catatan: biaya transfer dan token rebase tidak sesuai dengan Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Transaksi ini tidak akan berhasil baik karena pergerakan harga atau biaya transfer. Coba tingkatkan toleransi selip Anda.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Batas waktu transaksi","Transaction rejected":"Transaksi ditolak","Transaction submitted":"Transaksi terkirim","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Coba tingkatkan toleransi selip Anda.<0/>CATATAN: Biaya transfer dan token rebase tidak sesuai dengan Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Kesalahan yang tidak diduga. Tidak dapat memperkirakan gas untuk swap.","Unexpected issue with estimating the gas. Please try again.":"Masalah tak terduga dengan memperkirakan gas. Silakan coba lagi.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Lihat di Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Peringatan","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Transaksi Anda akan dikembalikan jika telah tertunda lebih lama dari periode waktu ini.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Transaksi Anda akan dikembalikan jika harga berubah lebih dari persentase ini.","minutes":"menit","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," biaya"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

export { idID as default };
